import heapq

def findMaximizedCapital(k, W, Profits, Capital):
    projects = sorted(zip(Profits, Capital), key=lambda x: x[1])
    max_heap = []
    i = 1
    for _ in range(k):
        while i < len(projects) and projects[i][1] <= W:
            heapq.heappush(max_heap, -projects[i][0])
            i += 1
        if max_heap:
            W += -heapq.heappop(max_heap)
        else:
            break
    return W

